  do j = 1, ndglg
  do i = 1, ndlon
    lonlat1 = lambert_lonlat (2*k+1:2*k+2)
    lonlat2 = grid%lonlat (i, j)

    FCTEST_CHECK (abs (lonlat1 (1) - lonlat2 (1)) < 0.001);
    FCTEST_CHECK (abs (lonlat1 (2) - lonlat2 (2)) < 0.001);

    k = k + 1
  enddo
  enddo

  call grid%final()

END_TEST

